<!DOCTYPE html>
<html>
<head>
  <title>JW Player - Star Hindi Live</title>
  <script src="https://cdn.jwplayer.com/libraries/IDzF9Zmk.js"></script>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    body {
      margin: 0;
      padding: 0;
      background: black;
      font-family: 'Segoe UI', sans-serif;
    }

    #player {
      width: 100%;
      height: 100vh;
    }

    .telegram-popup {
      position: fixed;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 320px;
      background: #1c1c1c;
      border-radius: 15px;
      box-shadow: 0 0 25px rgba(255, 102, 0, 0.6);
      padding: 25px;
      text-align: center;
      z-index: 9999;
      color: white;
      animation: fadeIn 0.7s ease;
    }

    .telegram-popup h2 {
      margin: 0 0 10px;
      color: orange;
      font-size: 20px;
    }

    .telegram-popup p {
      font-size: 14px;
      margin-bottom: 20px;
      color: #ccc;
    }

    .telegram-popup .btn {
      display: block;
      margin: 10px auto;
      width: 100%;
      padding: 12px;
      border: none;
      border-radius: 8px;
      font-size: 15px;
      font-weight: bold;
      cursor: pointer;
      transition: all 0.3s ease;
    }

    .telegram-popup .join-btn {
      background-color: orange;
      color: black;
    }

    .telegram-popup .join-btn:hover {
      background-color: #ff9900;
    }

    .telegram-popup .skip-btn {
      background-color: #2e2e2e;
      color: white;
    }

    .telegram-popup .skip-btn:hover {
      background-color: #444;
    }

    @keyframes fadeIn {
      from { opacity: 0; transform: scale(0.8) translate(-50%, -50%); }
      to { opacity: 1; transform: scale(1) translate(-50%, -50%); }
    }

    @media (max-width: 600px) {
      .telegram-popup {
        width: 90%;
        padding: 20px;
      }
    }
  </style>
</head>
